-- ----------------------------
-- Procedure structure for `callTemplateAndStandard`
-- ----------------------------
DROP PROCEDURE IF EXISTS `callTemplateAndStandard`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `callTemplateAndStandard`(categoryId INT, productId INT)
BEGIN

select * from t_category_template where category_id = categoryId and type = 2 order by value_order;

select * from t_product_standard where product_id = productId;


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `updateStandardValues`
-- ----------------------------
DROP PROCEDURE IF EXISTS `updateStandardValues`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `updateStandardValues`(`index` INT, categoryId INT)
BEGIN
	update t_product_standard
	set `VALUES` = CONCAT_WS(',',
		IF(substring_index(`VALUES`, ',', `index`-1)='',null,substring_index(`VALUES`, ',', `index`-1)),
		IF(substring_index(`VALUES`, ',', -(countSubstr(`VALUES`, ',')-`index`+1))='',null,substring_index(`VALUES`, ',', -(countSubstr(`VALUES`, ',')-`index`+1)))
	)
	where category_id = categoryId;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `countSubstr`
-- ----------------------------
DROP FUNCTION IF EXISTS `countSubstr`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `countSubstr`(str varchar(200), substr char(1)) RETURNS int(11)
BEGIN
DECLARE count INT;
SET count = (LENGTH(str) - LENGTH(REPLACE(str,substr, ""))) / LENGTH(substr);
RETURN count;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `nextValueOrder`
-- ----------------------------
DROP FUNCTION IF EXISTS `nextValueOrder`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `nextValueOrder`( type INT, categoryId INT) RETURNS int(11)
BEGIN
DECLARE result INT;
if type=1 then
set result = 0;
return result;
ELSE
select (MAX(value_order)+1) into result  from t_category_template where category_id=categoryId;
set result = IFNULL(result,1);
end if;
RETURN result;
END
;;
DELIMITER ;
